import React from 'react'
import { useNavigate } from "react-router-dom";
import {useState} from 'react'
import '../assets/scss/Register.scss'
import { Grid } from "../assets/UiKit/grid/Gird";
import { Line,Rows } from "../assets/UiKit/Line/Line";

export default function Register() {

    const [registerEmail, setEmail] = useState("");
    const [registerPassWord, setPassword] = useState("");
    const [confirmationPassWord, setConfirmationPassWordPassword] = useState("");
    const [phone_num, setPhone_num] = useState("");
    const [f_name, setF_name] = useState("");
    const [l_name, setL_name] = useState("");
    const [errorMessage, setErrorMessage] = useState("");

    function handlesubmit(e) {
      e.preventDefault();
      registerPassWord === confirmationPassWord
        ? register()
        : setErrorMessage(
            "ERROR: Your password and confirmation password do not match."
          );
    }
    const userDetails = {
      f_name: f_name,
      L_name: l_name,
      email: registerEmail,
      password: registerPassWord,
      password_validate: "registerPassWord",
      phone_num: phone_num,
      bio: "bio"
      // bio
    };
    async function register() {
      console.log(userDetails)
      try {
        const newUser = {
          "f_name": {
            "stringValue": userDetails.f_name
          },
          "l_name": {
            "stringValue": userDetails.l_name
          },
          "email": {
            "stringValue": userDetails.email
          },
          "password": {
            "stringValue": userDetails.password
          },
          "phone_num": {
            "stringValue": userDetails.phone_num
          },
          "bio": {
            "stringValue": userDetails.bio
        }
      }
          const response = await fetch('http://localhost:8000/signUp' , {
          method: 'POST',
          headers: {
            'Content-Type': 'application/json'
          },
            body: JSON.stringify({
              userDetails
            })
          });
          console.log(response);
          const data = await response.json();
          console.log(data);
        }
        catch (error) {
          console.log(error);
        }
      }

  return (
    <div className='RegisterContainer'>
    <Grid>
    <h2>Register User</h2>
        <form className="registerDiv" onSubmit={handlesubmit}>

    <Rows>
        <label>First Name</label>
        <input
          type="text"
          value={f_name}
          onChange={(e) => setF_name(e.target.value)}
        />
        <label>Last name</label>
        <input
          type="text"
          value={l_name}
          onChange={(e) => setL_name(e.target.value)}
        />
        <label>Email</label>
        <input
          type="email"
          value={registerEmail}
          onChange={(e) => setEmail(e.target.value)}
        />
        <label>Phone Number</label>
        <input
          type="phone"
          value={phone_num}
          onChange={(e) => setPhone_num(e.target.value)}
        />
        <label>Password</label>
        <input
          type="password"
          value={registerPassWord}
          onChange={(e) => setPassword(e.target.value)}
        />
        <label>Confirm Password</label>
        <input
          type="password"
          value={confirmationPassWord}
          onChange={(e) => setConfirmationPassWordPassword(e.target.value)}
        />
        <button type="submit"
        handlesubmit={handlesubmit}
        >Register</button>

        <p>{errorMessage}</p>







        </Rows>
        </form> 
        </Grid>
    </div>
  )
}
